import {
    Box,
    Button,
    Paper,
    Avatar
} from '@mui/material';

export function Home() {


    return (
        <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              gap: 4
            }}
        >
            <Button variant='contained' size='large' >
                Pedir Servicio
            </Button>
            <Box
                sx={{
                    my: 2
                }}
            >
                <Paper variant='elevation' elevation={2}>
                    <Box
                        sx={{
                            m: 2,
                            display: 'flex',
                            flexDirection: 'column',
                            gap: 2,
                            m: 2,
                        }}
                    >
                        <h4>Servicio: pendiente</h4>
                        <span>Fecha:</span>
                        <Box
                            sx={{
                                display: 'flex',
                                flexDirection: 'row',
                                justifyContent: 'space-evenly',
                                alignItems: 'center',
                                gap: 2
                            }}
                        >
                            <Avatar
                                sx={{ width: 56, height: 56 }}
                                alt='driver'
                                src='https://www.profilebakery.com/wp-content/uploads/2023/03/AI-Profile-Picture.jpg'
                            />
                            <span>Alfonso Guitierrez Lopez</span>
                        </Box>
                    </Box>
                </Paper>
            </Box>
        </Box>
    );
}
